func TestELEMENT12IsRandom(t *testing.T) {
	for i := 0; i < 50; i++ {
		var x, y Element12
		x.SetRandom()
		y.SetRandom()
		if x.Equal(&y) {
			t.Fatal("2 random numbers are unlikely to be equal")
		}
	}
}

